br.script:
var disqus_root = document.querySelector("#disqus_root");
var disqus_config = function () {
  this.page.url = "https://loading.io/spinner/";
  this.page.identifier = "/spinner/";
};
function disqusLoad() {
  disqus_root.loaded = true;
  var btn = document.querySelector("#disqus_root > .text-center");
  if(btn) { btn.parentNode.removeChild(btn); }
  (function() { // DON'T EDIT BELOW THIS LINE
  var d = document, s = d.createElement('script');
  s.src = 'https://loadingio.disqus.com/embed.js';
  s.setAttribute('data-timestamp', +new Date());
  s.setAttribute('defer',true);
  s.setAttribute('async',true);
  (d.head || d.body).appendChild(s);
  })();
}

(function(){
  var ib = new IntersectionObserver(function(ns) {
    if(!(ns[0] && ns[0].isIntersecting)) { return; }
    disqusLoad(); ib.unobserve(disqus_root);
  }, {});
  ib.observe(disqus_root);
})();
